import {
	FETCH_OFFERED,
	STATUS_OFFERED,
	MESSAGE_OFFERED,
} from 'constants/types/offered';

export const statusOffered = (status) => ({
	type: STATUS_OFFERED,
	payload: status,
});

export const fetchOffered = (offered) => ({
	type: FETCH_OFFERED,
	payload: offered,
});

export const messageOffered = (message) => ({
	type: MESSAGE_OFFERED,
	payload: message,
});
